import { Charg_Three, En_Hero, Middle } from "../comps/Portal";
import { homeCharging } from "../constants";

const Home_Charging = () => {
  return (
    <>
      <En_Hero
        prod={homeCharging}
        title="Home Charging"
        customLinkLabel="Shop Now"
        get="/"
      />
      <Charg_Three thing={homeCharging.ways} />
      {homeCharging.middles.map((item, index) => {
        return (
          <section key={index} className="padding-y padding-container">
            <img src={item.cover} alt={item.title} />
            <Middle
              topic={item.topic}
              title={item.title}
              describe={item.describe}
              learnLink={item.learnLink}
            />
          </section>
        );
      })}
    </>
  );
};

export default Home_Charging;
